import React from 'react';
import facebookLogo from '../facebook.svg';
import homeSvg from '../house-solid.svg';
import videoSvg from '../video-solid.svg';
import gameSvg from '../gamepad-solid.svg';
import userSvg from '../circle-user-solid.svg';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';
export default function Navbar() {
  return (
    <div>
      <nav>
        <div className='row row-cols-5 nav-pad nav-height'>
            <div>
               <div className='row row-cols-2'>
                   <i><img className='icon_style' src={facebookLogo} alt='icon facebak'/></i>
               </div>
               <div className='recherche'>
                   <input type='search' placeholder='Rechercher sur facebak'></input>
               </div>
            </div>
            <div className='icon_margin bor1'>
                <FontAwesomeIcon icon={faHouse} className='icon_style'/>
            </div>
            <div className='icon_margin_v bor1'>
                <i><img className='icon_style' src={videoSvg} alt='video icon'/></i>
            </div>
            <div className='icon_margin_v bor1'>
                <i><img className='icon_style' src={gameSvg} alt='gaming icon'/></i>
            </div>
            <div className='bor'>
                <i><img className='icon_style' src={userSvg} alt='profil picture'/></i>
            </div>
        </div>
      </nav>
    </div>
  );
}
